import React from "react";
import { Typography } from "@mui/material";

const Firstpage = (props) => {
  return (
    <header className="header">
      <div className="h2">
        <div className="h1">
          <Typography>Home</Typography>
        </div>
        <div className="h1">
          <Typography>9th-10th</Typography>
        </div>
        <div className="h1">
          <Typography className="h1">11th-12th</Typography>
        </div>
        <div className="h1">
          <Typography className="h1">Undergraduate</Typography>
        </div>
        <div className="h1">
          <Typography className="h1">Study Abroad</Typography>
        </div>
        <div className="h1">
          <Typography>Blog</Typography>
        </div>
      </div>
    </header>
  );
};

export default Firstpage;
